import React from 'react';
import './Home.css';

function HomePage() {
  return (
    <div className="home">
      <h1>Welcome to DevsOnDeck</h1>
      <p>Your platform for connecting with talented developers or finding the perfect job opportunity.</p>

      <div className="home-actions">
        <button className="home-button">For Developers</button>
        <button className="home-button">For Organizations</button>
      </div>

      <div className="home-features">
        <h2>Features</h2>
        <ul>
          <li>Match with top companies actively hiring developers</li>
          <li>Build a profile showcasing your skills and experience</li>
          <li>Stay updated on the latest job postings</li>
        </ul>
      </div>

      {/* Témoignages ou aperçu de membres */}
      <div className="home-testimonials">
        <h2>What Our Users Say</h2>
        <p>“DevsOnDeck helped me find my dream job in no time!” — Developer User</p>
        <p>“Great platform to connect with skilled developers.” — Company Recruiter</p>
      </div>
    </div>
  );
}

export default HomePage;
